import React, { useState } from 'react'

const Search = () => {

    const [img, setImg] = useState('')
    
    const inputEvent = (event) => {
        const data = event.target.value
        console.log(data)
    }

    return (
        <>
        <div className="searchbar">
           <input 
              type="text"
              placeholder = "Search..." 
              value = { data }
              onChange = { inputEvent }
            />
        </div>   
        </>
    )
}

export default Search
